script: |
  super -f text -I q3546.spq | sort > q3546.out

inputs:
  - name: q3546.spq
    data: |
      SELECT DISTINCT + col1 FROM tab1 (FORMAT parquet) WHERE NOT ( 24 * col0 + CAST ( + 92 + - col2 AS INTEGER ) ) NOT BETWEEN col1 AND ( + col2 );
  - name: tab1

outputs:
  - name: q3546.out
    data: |
